style.css:
@namespace url(http://www.w3.org/1999/xhtml); 
@-moz-document domain("an-chat.ru"){
html {
    background: #222;
}

.header {
    border-bottom: 1px solid #394046;
}

.chat {
    background: #292929;
    border: 1px solid #394046;
}


.dialogs {
    border-right: 1px solid #394046;
}

.dialog{
    border-bottom: 1px solid #394046;
}

.dialog:hover {
    background: #353535
}

.chat-flush {
    color: #f58e78;
}

.chat-flush:hover{
    color: #bf705f;
}

.field{
    border-top: 1px solid #394046;
}

input[type="text"]{
    color: #858b92
}

.chat-preview {
    color: #fff;
}

.a-color{
    color: #fff;
}

.spinner-loader {
    background: #858b92;
}

.dark ::-webkit-scrollbar-track {
    background-color: #292929;
}

.dark ::-webkit-scrollbar-thumb{
    background: #f58e78;
    border-radius: 15px;
}

.d-active {
    background: #bf705f;
    border-top: 0.15em solid #394046;
    border-bottom: 0.15em solid #394046;
}

.d-active:hover {
    background: #bf705f;
}

.i-text {
    color: #858b92
}

.fa, .fas {
    color: #bf705f;
}

.text {
    color: #858b92;
}

.i-time {
    color: #5c6065;
}

.i-name {
    color: #f58e78;
}

.chat-name {
    color: #ddd;
}

.chat-field {
    background: #222;
}

.type-user {
    color: #aaa;
}
a[target=_blank] {
    visibility: hidden;
}

.dark {
    background: #222;
}

.dark .header {
    border-bottom: 1px solid #394046;
}

.dark .chat {
